import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Header from './Header';
//import Forms from './Forms';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<App passFun={cartVal} />, document.getElementById('root'));
ReactDOM.render(<Header iCount={0} />, document.getElementById('hroot'));

function cartVal(qty)
{
    ReactDOM.render(<Header iCount={qty} />, document.getElementById('hroot'));
}

//ReactDOM.render(<Forms />, document.getElementById('root'));
